import React, { Component } from 'react';
import ReactTable from "react-table";
import "react-table/react-table.css";
import "../Css/Data.css";

class Data extends Component {

  render() {
    const data = [{
      title:  [<a href="https://github.com/mikifriki/Assembly-Homework" class="link">Assembly homework</a> ],
      des: 26,
      lang: '',
      creat: '',
    },{
      title: 'Sam Thomason',
      des: 22,
      lang: '',
      creat: ''
    },{
      title: 'Michael Jackson',
      des: 36,
      lang: '',
      creat: ''
    },{
      title: 'Samuel Roy',
      des: 56,
      lang: '',
      creat: ''
    },{
      title: 'Rima Soy',
      des: 28,
      lang: '',
      creat: ''
    },{
      title: 'Suzi Eliamma',
      des: 28,
      lang: '',
      creat: ''
    }]

    const columns = [{
      Header: 'Title',
      accessor: 'title',
   /*    Cell: porp => <a href="https://github.com/miifriki/Assembly-Homework" class="plainLink"> {porp.value}</a> */
    },{
      Header: 'Description',
      accessor: 'des',
      sortable: false
    },{
        Header: 'Language',
        accessor: 'lang'
    },{
        Header: 'Created at',
        accessor: 'creat'
    }]

    return (
          <div class="table">
          <h2 class="head"> Github Repositories</h2>
              <ReactTable
                data={data}
                columns={columns}
                defaultPdesSize = {3}
                pdesSizeOptions = {[3, 6]}
              />
              <div id="opensource-projects"></div> 

          </div>      
    )

  }
}


  export default Data;
